import React from "react";
import {Container,Row,Grid} from "react-bootstrap"

const Dashboard=()=>{
    return (
        <Container>
  <Row>
    <Col>1 of 3</Col>
    <Col xs={6}>2 of 3 (wider)</Col>
    <Col>3 of 3</Col>
  </Row>
  <Row>
    <Col>1 of 3</Col>
    <Col xs={5}>2 of 3 (wider)</Col>
    <Col>3 of 3</Col>
  </Row>
</Container>
    )
}
export default Dashboard;
